var title_f29_51_30524="Classification of neutrophilia";
var content_f29_51_30524=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F80503&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F80503&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of neutrophilia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Spurious",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Platelet clumping",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mixed cryoglobulinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Primary (no other evident associated disease)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hereditary neutrophilia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic idiopathic neutrophilia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Myeloproliferative disorders",
"        </strong>",
"        (eg, CML, PV,ET)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Familial myeloproliferative disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congenital anomalies and leukemoid reaction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Down syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Leukocyte adhesion factor deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Familial cold urticaria and leukocytosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Secondary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Infection",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Stress",
"        </strong>",
"        &nbsp;(physical or emotional stress, vigorous exercise)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myocardial infarction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cigarette smoking",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <strong>",
"         Glucocorticoids",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Catecholamines (epinephrine)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Lithium",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <strong>",
"         Recombinant G-CSF or GM-CSF*",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        All-trans retinoic acid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Isolated case reports for occasional other drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nonhematologic malignancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Heatstroke",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Generalized marrow stimulation (as in hemolysis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asplenia and hyposplenism",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Most commonly encountered causes of neutrophilia are shown in",
"    <strong>",
"     bold",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"     CML: chronic myelogenous leukemia; PV: polycythemia vera; ET: essential thrombocythemia; G-CSF: granulocyte colony-stimulating factor; GM-CSF: granulocyte-macrophage colony-stimulating factor.",
"     <br>",
"      * These agents are used therapeutically to raise the neutrophil count.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
